@Katy M Unfortunately that is the result of the hedonistic society we created in the past few decades, were 75% of marriages result in divorces and both parents are working - children are left to fend for themselves and have no proper or stable role models. 

Most people with NPD (Narcissistic Personality Disorder) were also once victims, young children who were abused, neglected, invalidated  or all of the above - but then CHOSE (this is the keyword) to become monsters and abusers themselves (so they should not be pitied).

NPD and all cluster B disorders are NOT a mental disease, nor is it something that can be cured for the simple reason that the disorder is WHO THEY ARE. They know EXACTLY what they are doing, they know how much suffering they cause to others - they just don't care. That is how selfish - and therefore evil - they are.
